prompt:
Problem 1: The set $S = \{1, 2, 3, \ldots, 2006\}$ is partitioned into two disjoint subsets $A$ and $B$ such that:

1. $13 \in A$;
2. If $a \in A$, $b \in B$, and $a + b \in S$, then $a + b \in B$;
3. If $a \in A$, $b \in B$, and $ab \in S$, then $ab \in A$.

Determine the number of elements in $A$.

The following figure shows a walk of length 6:

```asy
unitsize(20);
for (int x = -5; x <= 5; ++x)
  for (int y = 0; y <= 5; ++y)
    dot((x, y));
label("$O$", (0, 0), S);
draw((0, 0) -- (1, 0) -- (1, 1) -- (0, 1) -- (-1, 1) -- (-1, 2) -- (-1, 3));
```

This walk has three interesting properties:

- It starts at the origin, labeled $O$.
- Each step is 1 unit north, east, or west. There are no south steps.
- The walk never comes back to a point it has been to.

Let's call a walk with these three properties a northern walk. There are 3 northern walks of length 1 and 7 northern walks of length 2. How many northern walks of length 6 are there?

