prompt:
The grid below contains five rows with six points in each row. Points that are adjacent either horizontally or vertically are a distance of one unit apart. Find the area of the pentagon shown.

\[\text{[asy]}\]
\text{size}(150);\text{defaultpen}(\text{linewidth}(0.9));
\text{for}(\text{int } i=0; i \leq 5; ++i){
  \text{for}(\text{int } j=0; j \leq 4; ++j){
    \text{dot}((i,j));
  }
}
\text{draw}((3,0)--(0,1)--(1,4)--(4,4)--(5,2)--\text{cycle});
\[\text{[/asy]}\]

